import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import { AuthenticationBody } from './components';


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/login" element={<AuthenticationBody />} />

      </Routes>
    </div>
  );
}

export default App;
